import React from 'react'

class Fish extends React.Component {
    render() {
        const { image, name } = this.props.details;
        return (
            <React.Fragment>
                <li className="menu-fish">
                    <img src={this.props.details.image} alt={this.props.details.name} />
                    <h3></h3>
                </li>
            </React.Fragment>
        )
    }
}

export default Fish;
